The GROHE Bath & Design Awards, in association with Architectural Digest India (AD),set out to find the next big league of designers and architects. Meet Shervanaz, who describes the intricate marble artwork done by the local artisans in the flea markets of Agra, as the inspiration for this bath space. 

She further adds, "Infusing luxury with minimalism, this gorgeous home spa; accessorized by luscious greens and ornate marble artwork using 'Mother of Pearl Inlays', speaks volumes about the craftsmanship of our team members headed by the late Sonu Jangid. This was the last work of art completed by him before he succumbed to COVID-19 and passed away. This project is a tribute to him and his skilled workmanship.”

A design theme that reflects a commitment to the environment, product ranges that offers sustainable solutions were given preferences in designing this bath space.  She describes the 'GROHE SilkMove Technology', that provides controlled water supply with precise temperature control, along with 'GROHE EcoJoy Technology', that saves upto 50% of water, as her favourite product technologies used in this bath space."
